	this.initColorPicker=function(content){
		var colorPicker=jQuery('#'+content+' .my-color-field');
		var myOptions = {
			defaultColor: false,
			change: function(event, ui){ jQuery(this).trigger('change')},
			clear: function() {},
			hide: true,
			palettes: true
		};
		colorPicker.each(function(){
			var selector=jQuery(this);
			var selectorContainer=selector.parent('div');
			selector.wpColorPicker(myOptions);
			selectorContainer.find('.wp-color-result').attr('title',selector.attr('data-title'));
			selectorContainer.addClass('df-picker-container');
		})
	}
	
	this.initUploader=function(content){
		var mediaUploader;
		var uploadButton=jQuery('#'+content+' .df-upload-button');
		var deleteUploadButton=jQuery('#'+content+' .df-delete-upload-button');
		uploadButton.unbind('click');
		deleteUploadButton.unbind('click');
		uploadButton.click(function(e) {
			var selector=jQuery(this);
			var inputHandler=selector.parent('div').find('input:hidden');
			var imageHandler=selector.parent('div').parent('div').find('img');
			e.preventDefault();
			mediaUploader = wp.media.frames.file_frame = wp.media({
			  title: 'Choose Image',
			  button: {
			  text: 'Choose Image'
			}, 
			multiple: false });
			  mediaUploader.on('select', function() {
				  attachment = mediaUploader.state().get('selection').first().toJSON();
				  inputHandler.val(attachment.url);
				  inputHandler.trigger('change');
				  imageHandler.attr('src',attachment.url);
			});
			mediaUploader.open();
		});
		
		deleteUploadButton.click(function(e) {
			var selector=jQuery(this);
			var inputHandler=selector.parent('div').find('input:hidden');
			var imageHandler=selector.parent('div').parent('div').find('img');
			e.preventDefault();
			inputHandler.val('');
			inputHandler.trigger('change');
			imageHandler.attr('src',dfThemeOptionObj.templateUrl+'/inc/df-core/asset/images/admin/no_img_upload.png');

		});
	}
	
	this.initSwitch=function(content){
		var switcher=jQuery('#'+content+' .df-switch');
		switcher.unbind('click');
		switcher.on('click',function() {
			var selector=jQuery(this);
			var inputHandler=selector.find('input');
			selector.toggleClass('On').toggleClass('Off');
			if(selector.hasClass('On')){
				inputHandler.val('yes');
			} else {
				inputHandler.val('no');
			}
			inputHandler.trigger('change');
		});
		
		switcher.each(function(){	
			var selector=jQuery(this);
			var inputHandler=selector.find('input');
			if(inputHandler.val()==='yes'){
			  selector.removeClass('Off');
			  selector.addClass('On');
			} else {
			  selector.removeClass('On');
			  selector.addClass('Off');
			  inputHandler.val('no');
			};
			var isAdditional=selector.attr('data-additional');
			var dataArea=selector.attr('data-area');
			if(isAdditional == 'true'){
				if(inputHandler.val()=='no'){
					jQuery("#"+dataArea).hide();
				};
				inputHandler.change(function(e){
					var parentDiv=jQuery(this).parent('div');
					if(parentDiv.hasClass('On')){
						jQuery("#"+dataArea).show();
					} else {
						jQuery("#"+dataArea).hide();
					};
				});
			}
		  
		});
	}
	
	this.initCheckbox=function(content){
		var checkboxElement=jQuery('#'+content+' .df-to-checkbox');
		checkboxElement.unbind('click');
		checkboxElement.on('click',function(e) {
			var selector=jQuery(this);
			var inputHandler=selector.find('input');
			selector.toggleClass('checked');
			if(selector.hasClass('checked')){
				inputHandler.val('yes');
			} else {
				inputHandler.val('no');
			}
			inputHandler.trigger('change');
		
		});
		
		checkboxElement.each(function(){
			var selector=jQuery(this);
			var inputHandler=selector.find('input');
			if(inputHandler.val()==='yes'){
				selector.addClass('checked');
			} else {
				inputHandler.val('no');
			};
		 });
	}
	
	this.initVisualSelector=function(content){
		var visualSelector=jQuery('#'+content+' .df-visual-select ul li img');
		var allWrapper=jQuery('#'+content+' .df-visual-select ul li');
		visualSelector.click(function(e) {
			var selector=jQuery(this);
			var inputHandler=selector.parent('li').parent('ul').parent('div').find('input:hidden');
			var wrapper=selector.parent('li');
			var divWrapper=selector.parent('li').parent('ul');
			divWrapper.children().removeClass('selected');
			e.preventDefault();
			inputHandler.val(selector.attr('data-id'));
			inputHandler.trigger('change');
			wrapper.addClass('selected');
		});
	}
	
	this.initSliderBar=function(content){
		var sliderBar=jQuery('#'+content+' .df-slider-bar');
		var sliderValue=jQuery('#'+content+' .slider-value');
		sliderBar.unbind('change');
		sliderValue.unbind('keyup');
		sliderValue.unbind('click');

		sliderBar.on('change',function() {
			var selector=jQuery(this);
			var inputHandler=selector.parent('div').find('.slider-value');
				inputHandler.val(parseInt(selector.val()));
				inputHandler.trigger('change');
		});
		sliderValue.on('change keyup click',function(e) {
			var selector=jQuery(this);
			var backgroundHandler=selector.parent('div').parent('div').find('.noUi-background');
			backgroundHandler.css('left',!isNaN(parseInt(selector.val())) && parseInt(selector.val()) >=0 ? parseInt(selector.val())<=100 ? parseInt(selector.val())+"%":100+"%":0+"%");
		});
		sliderValue.each(function(){
			
			var selector=jQuery(this);
			var slider=selector.parent('div').parent('div').find('.df-slider-bar');
			slider.noUiSlider({
				start: !isNaN(parseInt(selector.val()))?parseInt(selector.val()):0,
				behaviour: 'snap',
				connect: 'lower',
				step: 1,
				range: {
					'min':  0,
					'max':  100
				}
			});
		});

	}
	
