	this.checkUserField = function(content){
		var dfElement=jQuery("#"+content+" .df-to-element");
		dfElement.unbind('change');
		dfElement.change(function(){
			var selector=jQuery(this);
			if(selector.val() !== selector.attr('data-default')){
				selector.attr('data-status','changed');
			} else {
				selector.removeAttr('data-status');
			}
		})	
	}
	
	this.googleFont=function(content){
		
		var fonts=dfThemeOptions.parseFonts(dfThemeOptions.fonts);
		var select2Font=jQuery('#'+content+' .select2-font');
		var select2Global=jQuery('#'+content+' .select2-global');
		select2Font.each(function(){
			var selector=jQuery(this);
			var subset=selector.parent('div').parent('div').find('.select2-subset');
			var variant=selector.parent('div').parent('div').find('.select2-variant');
			selector.select2( {
								data: fonts,
								allowClear: true,
								placeholder: 'Select a value',
							} );
		
			selector.val(selector.attr('data-default')).trigger("change");
			if(selector.attr('data-default') !== ''){
				subset.select2( {
								allowClear: true,
								placeholder: 'Select a value',
								data:dfThemeOptions.fonts[selector.attr('data-default')].subsets
							} );
				subset.val(subset.attr('data-default')).trigger("change");
				variant.select2( { allowClear: true,
								   placeholder: 'Select a value',
								   data:dfThemeOptions.fonts[selector.attr('data-default')].variants } );
				variant.val(variant.attr('data-default')).trigger("change");
			} else {
				subset.select2( {
								allowClear: true,
								placeholder: 'Select a value',
								data:{}
							} );
				subset.val(subset.attr('data-default')).trigger("change");
				variant.select2( { allowClear: true,
								   placeholder: 'Select a value',
								   data:{}
							   } );
				variant.val(variant.attr('data-default')).trigger("change");
			}
		});

		select2Global.each(function(){
			var selector2=jQuery(this);
			selector2.select2( {
								allowClear: true,
								placeholder: 'Select a value',
								data:{}
							} );
		});
		select2Font.change(function(){
			var selector=jQuery(this);
			var subset=selector.parent('div').parent('div').find('.select2-subset');
			var variant=selector.parent('div').parent('div').find('.select2-variant');
			subset.children('option').remove();
			variant.children('option').remove();
			subset.select2( { data: dfThemeOptions.fonts[this.value].subsets } );
			variant.select2( { data: dfThemeOptions.fonts[this.value].variants } );
			subset.trigger('change');
			variant.trigger('change');
		});

	}
	this.checkSidebarField = function(){
		jQuery("#additional-sidebar input").unbind('change');
		jQuery("#additional-sidebar input").change(function(){
			if(jQuery(this).val() !== jQuery(this).attr('data-default')){
				jQuery(this).attr('data-status','changed');

			} else {
				jQuery(this).removeAttr('data-status');
			}
			
		})	
	}
	
	this.boxInit=function($content){
		var dfElement=jQuery("#"+$content+" h3.accordion-section-title");
		dfElement.on("click", function(){
			var selector = jQuery(this);
			var selectorContainer=selector.parents("li.accordion-section");
			var otherSelectorContainer=jQuery("#"+$content+" li.accordion-section");
			var isAjax=selector.parents("li.accordion-section").attr('is-ajax');
			var view=selector.parents("li.accordion-section").attr('data-view');
			var content=selector.next();
			var dataID=content.attr('data-id');
			var dataName=content.attr('data-name');
			var parameter={'view':view,
							'dataID':dataID,
							'dataName':dataName };
			var otherContent=jQuery("#"+$content+" .accordion-section-content");
			if(isAjax=='true'){
				if( content.attr('data-content') == 'none' ){
					dfThemeOptions.dfAjaxCall("df_load_box",parameter,function(response){
						content.html(response);
						if( selectorContainer.hasClass("open") ){
							selectorContainer.removeClass("open");
							otherContent.slideUp("fast");
						}
						else{
							otherContent.slideUp("fast");
							content.slideDown("fast");

							otherSelectorContainer.removeClass("open");
							selectorContainer.addClass("open");
						}
					content.removeAttr('data-content');
					dfThemeOptions.preInit(content);
					})
				} else {
					if( selectorContainer.hasClass("open") ){
						selectorContainer.removeClass("open");
						otherContent.slideUp("fast");
					}
					else{
						otherContent.slideUp("fast");
						content.slideDown("fast");

						otherSelectorContainer.removeClass("open");
						selectorContainer.addClass("open");
					}
				}
				
			} else {
				if( selectorContainer.hasClass("open") ){
					selectorContainer.removeClass("open");
					otherContent.slideUp("fast");
				}
				else{
					otherContent.slideUp("fast");
					content.slideDown("fast");

					otherSelectorContainer.removeClass("open");
					selectorContainer.addClass("open");
				}
			}
			
			
		});
	}
	
	this.sidebarInit = function () {
		jQuery("#df-sidebars").on("click", "h3.accordion-section-title", function(){
					var current = jQuery(this);
					
					if( current.parents("li.accordion-section").hasClass("open") ){
						jQuery(this).parents("li.accordion-section").removeClass("open");
						jQuery("#df-sidebars .accordion-section-content").slideUp("fast");
					}
					else{
						jQuery("#df-sidebars .accordion-section-content").slideUp("fast");
						jQuery(this).next().slideDown("fast");

						jQuery("#df-sidebars li.accordion-section").removeClass("open");
						jQuery(this).parents("li.accordion-section").addClass("open");
					}
		});
		jQuery(".btn-add-new-sidebar").on('click', function () {
					var id = 'dfs_' + dfThemeOptions.sidebarGenerateID (3, 'n') + dfThemeOptions.sidebarGenerateID (3, 'l');
					var html = '<li id="'+ id +'" class="control-section accordion-section">';
					html += '<h3 class="accordion-section-title">New Sidebars<a href="#" class="df-sidebars-delete " data-id="'+ id +'"><i class="fa fa-trash-o"></i></a></h3>';
					html += '<div class="accordion-section-content">';
					html += '<div><h4>Name</h4>';
					html += '<input id="sidebars[additional]['+ id +'][name]" class="df-to-element df-input-styled" type="text" data-default=""  name="sidebars[additional]['+ id +'][name]" value="" required>';
					html += '</div>'
					html += '<input id="sidebars[additional]['+ id +'][id]" class="df-to-element df-input-styled" type="hidden" data-default="" name="sidebars[additional]['+ id +'][id]" value="'+ id +'">';
					html += '<div>';
					html += '<h4>Description</h4>';
					html += '<textarea id="sidebars[additional]['+ id +'][description]" class="df-to-element large-text code " data-default=""  name="sidebars[additional]['+ id +'][description]"></textarea>';
					html += '</div>';
					html += '</div>';
					html += '</li>';
					jQuery( '.connected-sidebars-lists' ).append( html );
					dfThemeOptions.checkSidebarField();
					dfThemeOptions.initDeleteSidebarButton();
					jQuery("#additional-sidebar .df-to-element").attr('data-status','changed');
					return false;
				});
		dfThemeOptions.initDeleteSidebarButton();
	}

	this.initDeleteSidebarButton = function () {
		jQuery(".df-sidebars-delete").unbind('click')
		jQuery(".df-sidebars-delete").on('click', function () {
			var ID = jQuery( this ).data('id');
			jQuery('#' + ID).remove();
			jQuery("#additional-sidebar .df-to-element").attr('data-status','changed');
			return false;
		});
	}
	this.sidebarGenerateID = function ( length , mode ) {
		var id = "",
					nb = "0123456789",
					lt = "abcdefghijklmnopqrstuvwxyz",
					possible;
					if( mode == 'l' ){
						possible = lt;
					}
					else if( mode == 'n' ){
						possible = nb;
					}
					else{
						possible = nb + lt;
					}

				for( var i=0; i < length; i++ ){
					id += possible.charAt(Math.floor(Math.random() * possible.length));
				}

				return id;
	}
	this.preLoaderStyleInit = function(){
		var selector = jQuery('select[name="general[page_transition][preloader_style]"]');
		if( selector.val() == 'none' ){
			jQuery('#detail-load-css-animation').hide();
			jQuery('#detail-load-image').hide();
		}else{
			if( selector.val() == 'css-animation' ){
	 			jQuery('#detail-load-css-animation').show();
				jQuery('#detail-load-image').hide();
	 		}
	 		if( selector.val() == 'image' ){
				jQuery('#detail-load-image').show();
				jQuery('#detail-load-css-animation').hide();
	 		}
		}
		selector.on('change',function(){
   		 	// alert();
   		 	var detailVal = selector.val();
   		 	if( detailVal == 'none' ){
   		 		jQuery('#detail-load-css-animation').hide();
				jQuery('#detail-load-image').hide();
   		 	}else{
   		 		if( detailVal == 'css-animation' ){
   		 			jQuery('#detail-load-css-animation').show();
					jQuery('#detail-load-image').hide();
   		 		}
   		 		if( detailVal == 'image' ){
					jQuery('#detail-load-image').show();
					jQuery('#detail-load-css-animation').hide();
   		 		}
   		 	}
		});
	}
	this.preInit=function($content){
			
		var idContent=$content.attr('id');
		
		if( jQuery("#"+idContent+' .my-color-field').length > 0 ){
			dfThemeOptions.initColorPicker($content.attr('id'));
		}
		
		dfThemeOptions.checkUserField(idContent);
		jQuery('.df-button-import').click(function(e){			
		e.preventDefault();
			dfThemeOptions.dfAjaxCall('import_options',jQuery('#theme-options textarea[name="import[import]"]').val(),function(response){
				for(var menu in dfThemeOptions.openedMenu){
					dfThemeOptions.loadAllSection( dfThemeOptions.openedMenu[menu].contentID, dfThemeOptions.openedMenu[menu].menuID);
				}
			})
		});
		if( jQuery("#"+idContent+' .df-box-element').length > 0 ){
			dfThemeOptions.boxInit($content.attr('id'));
		}
		if( jQuery("#"+idContent+' .select2-font').length > 0 ){
			dfThemeOptions.googleFont($content.attr('id'));
		}
		if( jQuery("#"+idContent+' .df-slider-bar').length > 0 ){
			dfThemeOptions.initSliderBar($content.attr('id'));
		}
		if( jQuery("#"+idContent+' .df-switch').length > 0 ){
			dfThemeOptions.initSwitch($content.attr('id'));
		}
		if( jQuery("#"+idContent+' .df-upload-button').length > 0 ){
			dfThemeOptions.initUploader($content.attr('id'));
		}
		if( jQuery("#"+idContent+' .df-to-checkbox').length > 0 ){
			dfThemeOptions.initCheckbox($content.attr('id'));
		}
		if( jQuery("#"+idContent+' .df-visual-select').length > 0 ){
			dfThemeOptions.initVisualSelector($content.attr('id'));
		}
		 if( idContent == 'additional-sidebar' ){
			 dfThemeOptions.sidebarInit();
		 }
		if( idContent == 'page-transition'){
			dfThemeOptions.preLoaderStyleInit();
		}
	}
	
	this.parseFonts=function(obj){

            var keys = [], name;
            for (name in obj) {
                if (obj.hasOwnProperty(name)) {
                    keys.push(name);
                }
            }
            return keys;
	}
	this.resetSection=function( content, menu ){

		dfThemeOptions.dfAjaxCall("df_reset_section", menu, function(response){
			content.html(response);
			dfThemeOptions.preInit(content);
		})
	}
	
	this.loadAllSection=function( content, menu ){

		dfThemeOptions.dfAjaxCall("df_load_extended_view", menu, function(response){
			content.html(response);
			dfThemeOptions.preInit(content);
		})
	}
	
	this.resetAll=function(){
		dfThemeOptions.dfAjaxCall("df_reset_section", 'all', function(response){
			for(var menu in dfThemeOptions.openedMenu){
				dfThemeOptions.loadAllSection( dfThemeOptions.openedMenu[menu].contentID, dfThemeOptions.openedMenu[menu].menuID);
			}
		})
	}
	this.init=function(){
		jQuery(".df-button-save").click(function(e){
			e.preventDefault();
			//alert(  ||  ) ;
			if( jQuery('#theme-options .df-to-element').filter('[data-status=changed]').length > 0){
				//handling sidebar
				jQuery('#additional-sidebar input, textarea').attr('data-status','changed');
				//end handling sidebar
				dfThemeOptions.dfAjaxCall("update_options",jQuery('#theme-options .df-to-element').filter('[data-status=changed]').serializeArray(),function(response){
					  alert('update Successfully');
					  jQuery('#theme-options .df-to-element').filter('[data-status=changed]').each(function(){
						if(jQuery(this).attr('type') !== 'radio'){
							jQuery(this).attr('data-default',jQuery(this).val());
						}  
					  })
					  jQuery('#theme-options .df-to-element').removeAttr('data-status');
				  });
			} else {
				alert('you did not change anything');
			}
			  
		});
		jQuery(".df-button-reset-section").click(function(e){
			dfThemeOptions.resetSection( dfThemeOptions.contentID, dfThemeOptions.menuID );
		});
		jQuery(".df-button-reset-all").click(function(e){
			dfThemeOptions.resetAll();
		});
	}

